'use strict';CKEDITOR.plugins.setLang("a11yhelp","sv",{title:"Hj\u00e4lpmedelsinstruktioner",contents:"Hj\u00e4lpinneh\u00e5ll. F\u00f6r att st\u00e4nga denna dialogruta trycker du p\u00e5 ESC.",legend:[{name:"Allm\u00e4nt",items:[{name:"Editor verktygsf\u00e4lt",legend:"Tryck p\u00e5 $ {toolbarFocus} f\u00f6r att navigera till verktygsf\u00e4ltet. Flytta till n\u00e4sta och f\u00f6reg\u00e5ende verktygsf\u00e4ltsgrupp med TAB och SHIFT-TAB. Flytta till n\u00e4sta och f\u00f6reg\u00e5ende knapp i verktygsf\u00e4ltet med H\u00d6GERPIL eller V\u00c4NSTERPIL. Tryck Space eller ENTER f\u00f6r att aktivera knappen i verktygsf\u00e4ltet."},{name:"Dialogeditor",legend:"Inuti en dialogruta, tryck TAB f\u00f6r att navigera till n\u00e4sta f\u00e4lt i dialogrutan. Du trycker SKIFT + TAB f\u00f6r att flytta till f\u00f6reg\u00e5ende f\u00e4lt. Tryck ENTER f\u00f6r att skicka. Du avbryter och st\u00e4nger dialogen med ESC. F\u00f6r dialogrutor som har flera flikar, tryck ALT + F10 navigera till fliklistan. Flytta sedan till n\u00e4sta flik med H\u00d6GERPIL. Flytta till f\u00f6reg\u00e5ende flik med SHIFT + TAB eller V\u00c4NSTERPIL. Tryck Space eller ENTER f\u00f6r att v\u00e4lja fliken."},{name:"Editor f\u00f6r inneh\u00e5llsmeny",legend:"Tryck p\u00e5 $ {contextMenu} eller PROGRAMTANGENTEN f\u00f6r att \u00f6ppna snabbmenyn. Flytta sedan till n\u00e4sta menyalternativ med TAB eller NEDPIL. Flytta till f\u00f6reg\u00e5ende alternativ med SHIFT + TABB eller UPPIL. Tryck Space eller ENTER f\u00f6r att v\u00e4lja menyalternativ. \u00d6ppna undermeny av nuvarande alternativ med SPACE eller ENTER eller H\u00d6GERPIL. G\u00e5 tillbaka till \u00f6verordnade menyalternativ med ESC eller V\u00c4NSTERPIL. St\u00e4ng snabbmenyn med ESC."},{name:"Editor f\u00f6r List Box",legend:"Inuti en list-box, g\u00e5 till n\u00e4sta listobjekt med TAB eller NEDPIL. Flytta till f\u00f6reg\u00e5ende listobjekt med SHIFT + TAB eller UPPIL. Tryck Space eller ENTER f\u00f6r att v\u00e4lja listan alternativet. Tryck ESC f\u00f6r att st\u00e4nga listan-boxen."},{name:"Editor f\u00f6r elementens s\u00f6kv\u00e4g",legend:"Tryck p\u00e5 $ {elementsPathFocus} f\u00f6r att navigera till verktygsf\u00e4ltet f\u00f6r elementens s\u00f6kv\u00e4gar. Flytta till n\u00e4sta elementknapp med TAB eller H\u00d6GERPIL. Flytta till f\u00f6reg\u00e5ende knapp med SKIFT + TAB eller V\u00c4NSTERPIL. Tryck Space eller ENTER f\u00f6r att v\u00e4lja element i redigeraren."}]},{name:"Kommandon",items:[{name:"Kommandot \u00e5ngra",legend:"Tryck p\u00e5 ${undo}"},{name:"Kommandot g\u00f6r om",legend:"Tryck p\u00e5 ${redo}"},{name:"Kommandot fet stil",legend:"Tryck p\u00e5 ${bold}"},{name:"Kommandot kursiv",legend:"Tryck p\u00e5 ${italic}"},{name:"Kommandot understruken",legend:"Tryck p\u00e5 ${underline}"},{name:"kommandot l\u00e4nk",legend:"Tryck p\u00e5 ${link}"},{name:"Verktygsf\u00e4lt D\u00f6lj kommandot",legend:"Tryck p\u00e5 ${toolbarCollapse}"},{name:"Hj\u00e4lp om hj\u00e4lpmedel",legend:"Tryck p\u00e5 $ {a11yHelp}"},{name:" Access next focus space command",legend:"Press ${accessNextSpace} to access the closest unreachable focus space after the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Accessibility Help",legend:"Press ${a11yHelp}"}]}]});